Los Ediles de la Patria

Planifican jornadas de desinfección y mantenimiento en área Covid del IHULA

***La presidenta del Concejo Municipal Libertador Greny Uzcategui  señaló que dentro del trabajo  se tiene prevista la limpieza de áreas verdes, espacios físicos e infraestructura***

A través del Concejo de Municipal Libertador y con el apoyo del protector del estado Mérida Jehyson Guzmán, se está planificando una jornada de desinfección y mantenimiento en el Área de Triaje para Pacientes con Síntomas Respiratorios  del Instituto Autónomo Hospital Universitario de los Andes (IAHULA), así lo informó Greny Uzcategui presidenta del parlamento edilicio.

Uzcategui destacó que junto a los  concejales Juan Carlos Uzcategui y Hugo Peña efectuó una visita este miércoles en horas de la mañana para inspeccionar el estado en el     que se encuentran las instalaciones y evaluar que se va a requerir para el despliegue de mantenimiento y limpieza.

La presidenta señaló que dentro de esta planificación se tiene prevista la limpieza de áreas verdes, espacios físicos e infraestructura, así como la desinfección continua de esta área de salud tan fundamental en momentos de pandemia.

Dotación de inmobiliario

Uzcategui informó  que en articulación con el protector Jehyson Guzmán canalizarán la dotación de algunos toldos y sillas para las personas que lleguen allí requiriendo atención.

Dijo la presidenta que desde el Concejo Municipal que  se mantendrán activos en todo lo relacionado con la prevención y atención del COVID-19, porque la protección de la salud y el bienestar del pueblo siempre serán la prioridad./ Prensa Concejo Municipal Libertador

